import React, { useState } from "react";
import "./signup.css";
import { useNavigate } from "react-router-dom";

export const Signup = () => {
  const navigate = useNavigate();

  // State for form fields
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    emailVerify: "",
    phone: "",
    password: "",
    passwordVerify: "",
  });

  // State for errors
  const [errors, setErrors] = useState("");

  // Function to handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;

    // Auto-format phone number
    if (name === "phone") {
      setFormData({ ...formData, phone: formatPhoneNumber(value) });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  // Function to format phone number as user types
  const formatPhoneNumber = (value) => {
    let cleaned = value.replace(/\D/g, ""); // Remove non-numeric characters
    let formatted = "";

    if (cleaned.length > 0) {
      formatted = `(${cleaned.substring(0, 3)}`;
    }
    if (cleaned.length > 3) {
      formatted += `) ${cleaned.substring(3, 6)}`;
    }
    if (cleaned.length > 6) {
      formatted += `-${cleaned.substring(6, 10)}`;
    }

    return formatted;
  };

  // Function to validate form before submission
  const validateForm = () => {
    if (
      !formData.fullName ||
      !formData.email ||
      !formData.emailVerify ||
      !formData.phone ||
      !formData.password ||
      !formData.passwordVerify
    ) {
      return "All fields are required.";
    }
    if (formData.email !== formData.emailVerify) {
      return "Emails do not match.";
    }
    if (formData.password !== formData.passwordVerify) {
      return "Passwords do not match.";
    }
    if (formData.phone.length < 14) {
      return "Invalid phone number format.";
    }
    return ""; // No errors
  };

  // Function to handle form submission
  const handleSignup = (e) => {
    e.preventDefault();

    // Validate form
    const error = validateForm();
    if (error) {
      setErrors(error);
      return;
    }

    console.log("Signing up...");
    navigate("/auth/login"); // Redirect to login after successful signup
  };

  return (
    <div className="signup-left">
      <div className="signup-form">
        <h1>Sign Up</h1>
        {errors && <p className="error-message">{errors}</p>}
        <form>
          <div className="fullname-input">
            <input
              type="text"
              name="fullName"
              placeholder="Full Name"
              value={formData.fullName}
              onChange={handleChange}
            />
          </div>
          <div className="email-input">
            <input
              type="email"
              name="email"
              placeholder="Enter email"
              value={formData.email}
              onChange={handleChange}
            />
          </div>
          <div className="emailVerify-input">
            <input
              type="email"
              name="emailVerify"
              placeholder="Verify email"
              value={formData.emailVerify}
              onChange={handleChange}
            />
          </div>
          <div className="phone-input">
            <input
              type="text"
              name="phone"
              placeholder="Phone Number"
              value={formData.phone}
              onChange={handleChange}
            />
          </div>
          <div className="password-input">
            <input
              type="password"
              name="password"
              placeholder="Create password"
              value={formData.password}
              onChange={handleChange}
            />
          </div>
          <div className="passwordVerify-input">
            <input
              type="password"
              name="passwordVerify"
              placeholder="Verify password"
              value={formData.passwordVerify}
              onChange={handleChange}
            />
          </div>
          <button type="submit" className="signup-button" onClick={handleSignup}>
            Sign Up
          </button>
        </form>
        <div className="login">
          Already have an account?{" "}
          <span className="nav-link" onClick={() => navigate("/auth/login")}>
            Login here
          </span>
        </div>
      </div>
    </div>
  );
};

export default Signup;
